## 附件七关于装饰装修及相关设备标准的约定

交付的商品房达不到本附件约定装修标准的，按照本合同第十四条第（三）款约定处理。出卖人未经双方约定增加的装置、装修、装饰，视为无条件赠送给买受人。

双方就装饰装修主要材料和设备的品牌、产地、规格、数量等内容约定如下：

1外墙：【瓷砖】【涂料】【玻璃幕墙】【】;



2起居室：

（1）内墙：【涂料】【壁纸】【】；

。（2）顶棚：【石膏板吊顶】【涂料】【】;

0（3）室内地面：【大理石】【花岗岩】【水泥抹面】【实木地板】【】;

3厨房：

（1）地面：【水泥抹面】【瓷砖】【】;

。（2）墙面：【耐水腻子】【瓷砖】【;

。（3）顶棚：【水泥抹面】【石膏吊顶】【】;

0（4）厨具：0

4卫生间：

（1）地面：【水泥抹面】【瓷砖】【】;

0（2）墙面：【耐水腻子】【瓷砖】【】;

0（3）顶棚：【水泥抹面】【石膏吊顶】【】;

0（4）卫生器具0

